import './Checkout.css'
function Checkout() {
    return (
        <div className="checkout">
            <div className="checkout__left">
                <img className="checkout__ad" src="https://images-eu.ssl-images-amazon.com/images/G/31/img20/Grocery/EssentialsStore/1500x300_essential-store1.jpg" alt=""></img>
            </div>
        </div>
    )
}

